export const categorySeeker = (dumyProductAPIData: ProductAPIDataProps) => {
  const categories: string[] = [];

  for (let i = 0; i < dumyProductAPIData.length; i++) {
    if (categories.indexOf(dumyProductAPIData[i].category) === -1) {
      categories.push(dumyProductAPIData[i].category);
    }
  }
  console.log(categories);
  return categories;
};
